import React from 'react';
import { Link } from 'react-router-dom';

export const Navbar = () => {
	return (
		<nav>
			<h1>Waleed Saleh</h1>
			<ul>
				<li>
					<Link to='/'>Home</Link>
				</li>
				<li>
					<Link to='/about'>About Me</Link>
				</li>
				<li>
					<Link to='/certify'>Certifications</Link>
				</li>
				<li>
					<Link to='/contact'>Contact Me</Link>
				</li>
			</ul>
		</nav>
	);
};
